import base64
import zlib
import marshal

# Kode yang terkompresi dan terenkode dalam base64
encoded_data = ""  
# Contoh data Base64 yang terkompresi

# Langkah-langkahnya:
# 1. Pembalikan string
reversed_data = encoded_data[::-1]

# 2. Dekode Base64
decoded_data = base64.b64decode(reversed_data)

# 3. Dekompresi dengan Zlib
decompressed_data = zlib.decompress(decoded_data)

# 4. Memuat data dengan Marshal (bytecode)
loaded_code = marshal.loads(decompressed_data)

# 5. Menampilkan kode asli yang telah dimuat
print(f"Original Code:\n{repr(loaded_code)}\n")

# 6. Eksekusi bytecode untuk menjalankan kode
exec(loaded_code)
